function Select2({ className, options, name, value, onChange, placeholder }) {
  return (
    <>
      <select
        name={name}
        value={value}
        onChange={onChange}
        className={className}
        placeholder={placeholder}
      >
        {options.map((item) => {
          return <option value={item.value} label={item.label}></option>
        })}
      </select>
    </>
  )
}
export default Select2
